latestIgtvVideos.caption:
I get makeup & product enquiries so often so I’ve finally made this video to show you how I apply makeup.
I honestly don’t know much about makeup techniques so I just do things as per my whims & wishes😅
I have used the most affordable products here, all under INR 1000.
.
If you are a makeup nincompoop like me, hope this helps!
(If you are a pro, please don’t judge me🙈)
.
